INSERT INTO `model_history` VALUES ('1', 'Insert', 'Key Data Store', 'fgx', 'key_data_store', '{\"name\":[\"key_data_store.id\",\"key_data_store.user_id\",\"key_data_store.key_store\",\"key_data_store.key_index\",\"key_data_store.key_value\",\"key_data_store.key_label\",\"key_data_store.key_detail\",\"key_data_store.key_order\",\"key_data_store.key_action\",\"key_data_store.key_authority\",\"key_data_store.key_authed_by\",\"key_data_store.key_state\",\"key_data_store.created_at\",\"key_data_store.updated_at\",\"key_data_store.deleted_at\",\"key_data_store.actioned_by\",\"users.first_name\",\"users.last_name\"],\"alias\":[\"Primary Key\",\"User id\",\"Key store\",\"Key index\",\"Key value\",\"Key label\",\"Key description\",\"Key ordering\",\"Key action\",\"The permission needed to approve key (User Type)\",\"This key needs approval from key authority (User Type)\",\"Data key state (On,Off)\",\"Date and time record was added\",\"Date and time records was updated\",\"Deleted at\",\"Action by\"],\"as\":{\"16\":\"user_full_name\",\"17\":\"user_full_name\"}}', '\"id\"', '[\"id\"]', '0', '[{\"table\":\"users\",\"type\":\"left\",\"left\":\"key_data_store.user_id\",\"right\":\"users.id\"}]', '0', '<?xml version=\"1.0\"?>\n<model><database connection=\"fgx\" name=\"keyDataStore\" alias=\"Key Data Store\" single=\"KeyDataStore\" many=\"KeyDataStores\" public=\"false\">\n    <table name=\"key_data_store\" key=\"id\">\n        <columns>\n            <user_id alias=\"User id\"/>\n            <key_store alias=\"Key store\"/>\n            <key_index alias=\"Key index\"/>\n            <key_value alias=\"Key value\"/>\n            <key_label alias=\"Key label\"/>\n            <key_detail alias=\"Key description\"/>\n            <key_order alias=\"Key ordering\"/>\n            <key_action alias=\"Key action\"/>\n            <key_authority alias=\"The permission needed to approve key (User Type)\"/>\n            <key_authed_by alias=\"This key needs approval from key authority (User Type)\"/>\n            <key_state alias=\"Data key state (On,Off)\"/>\n            <created_at alias=\"Date and time record was added\"/>\n            <updated_at alias=\"Date and time records was updated\"/>\n            <deleted_at alias=\"Deleted at\"/>.\n            <actioned_by alias=\"Action by\"/>.\n        </columns>\n    </table>\n    <join table=\"users\" type=\"left\" left=\"key_data_store.user_id\" right=\"users.id\">\n        <columns>\n            <first_name as=\"user_full_name\"/>\n            <last_name as=\"user_full_name\"/>\n        </columns>\n    </join>\n</database>\n<datasets>\n    <all alias=\"Select all data key value sets\" description=\"Select all data key value sets and ORDER BY `user_id`,`data_store` ASC\">\n        <order>\n            <user_id order=\"ASC\"/>\n            <key_order order=\"ASC\"/>\n        </order>\n    </all>\n\n    <active alias=\"Select active data keys\" description=\"Select data keys where `key_status` = \'On\' and ORDER BY by `user_id`,`data_store` ASC\">\n        <filter>\n            <key_status equal=\"On\"/>\n        </filter>\n        <order>\n            <user_id order=\"ASC\"/>\n            <key_order order=\"ASC\"/>\n        </order>\n    </active>\n\n    <onByUser alias=\"Select data keys by user and key status\" description=\"Select data keys where `key_status` = \'On\' and user_id = ${userId}\">\n        <filter>\n            <key_status equal=\"On\"/>\n            <user_id equal=\"${userId}\"/>\n        </filter>\n        <order>\n            <key_order order=\"ASC\"/>\n        </order>\n    </onByUser>\n\n    <byUser alias=\"Select data keys by user\" description=\"Select data keys WHERE user_id = ${userId}\">\n        <filter>\n            <user_id equal=\"${userId}\"/>\n        </filter>\n        <order>\n            <user_id order=\"ASC\"/>\n            <key_order order=\"ASC\"/>\n        </order>\n    </byUser>\n\n    <byStoreAndUser alias=\"Select data keys by user and data store\" description=\"Select data keys WHERE `user_id` = ${userId} AND `data_store` = ${store}\">\n        <filter>\n            <key_store equal=\"${store}\"/>\n            <user_id equal=\"${userId}\"/>\n        </filter>\n        <order>\n            <key_order order=\"ASC\"/>\n        </order>\n    </byStoreAndUser>\n\n    <byStoreKeyAndUser alias=\"Select data keys by user, data store and key\" description=\"Select data keys WHERE `user_id` = ${userId}, `key_store` = ${store} AND data_key = ${key}\">\n        <filter>\n            <user_id equal=\"${userId}\"/>\n            <key_store equal=\"${store}\"/>\n            <data_key equal=\"${key}\"/>\n        </filter>\n        <order>\n            <key_order order=\"ASC\"/>\n        </order>\n    </byStoreKeyAndUser>\n</datasets>\n</model>\n', 'INSERT INTO `key_data_store` (`user_id`, `key_store`, `key_index`, `key_label`, `key_detail`, `key_action`, `key_authority`, `key_state`, `created_at`, `updated_at`, `actioned_by`) VALUES (\'1\',\'console.settings.core\',\'useSockets\',\'Enable Web-Sockets\',\'Not compatible with your browser\',\'none\',\'none\',\'On\',\'2018-04-11 07:46:15\',\'2018-04-11 07:46:15\',\'Charl Cronje\')', 'SELECT `id` FROM `key_data_store` ORDER BY `id` DESC LIMIT 1; SELECT * FROM `key_data_store` WHERE `id` > \'11\'', '[]', '[]', '[]', 'object', '[]', '[\"key_data_store.id\",\"key_data_store.user_id\",\"key_data_store.key_store\",\"key_data_store.key_index\",\"key_data_store.key_value\",\"key_data_store.key_label\",\"key_data_store.key_detail\",\"key_data_store.key_order\",\"key_data_store.key_action\",\"key_data_store.key_authority\",\"key_data_store.key_authed_by\",\"key_data_store.key_state\",\"key_data_store.created_at\",\"key_data_store.updated_at\",\"key_data_store.deleted_at\",\"key_data_store.actioned_by\",\"users.first_name\",\"users.last_name\"]', '{\"16\":{\"as\":\"user_full_name\"},\"17\":{\"as\":\"user_full_name\"}}', '18', '', '', '', '[]', '[]', '[]', '\"\"', '\"\"', '\"\"', '[{\"id\":\"12\",\"use